import React, { useEffect, useState } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity, ActivityIndicator, Image, Dimensions } from 'react-native';
import { getUserDetails, logoutUser } from '../services/api';
import { SafeAreaView } from 'react-native-safe-area-context';
import { Ionicons } from '@expo/vector-icons';
import { LinearGradient } from 'expo-linear-gradient';

const { width } = Dimensions.get('window');

const ServiceCard = ({ title, icon, color, onPress }) => (
    <TouchableOpacity style={styles.card} onPress={onPress}>
        <View style={[styles.iconContainer, { backgroundColor: color + '15' }]}>
            <Ionicons name={icon} size={32} color={color} />
        </View>
        <Text style={styles.cardTitle}>{title}</Text>
        <View style={styles.arrowContainer}>
            <Ionicons name="arrow-forward" size={16} color="#CCC" />
        </View>
    </TouchableOpacity>
);

export default function DashboardScreen({ navigation }) {
    const [user, setUser] = useState(null);
    const [loading, setLoading] = useState(true);

    const services = [
        { id: 1, title: 'Electricity', icon: 'flash', color: '#FFB300', route: 'Electricity' },
        { id: 2, title: 'Water', icon: 'water', color: '#03A9F4', route: 'Water' },
        { id: 3, title: 'Gas', icon: 'flame', color: '#FF5722', route: 'Gas' },
        { id: 4, title: 'Property', icon: 'home', color: '#4CAF50', route: 'Property' }, // Placeholder route
        { id: 5, title: 'Grants', icon: 'cash', color: '#9C27B0', route: 'Grants' }, // Placeholder route
        { id: 6, title: 'Support', icon: 'headset', color: '#607D8B', route: 'Support' }, // Placeholder route
    ];

    useEffect(() => {
        fetchUserData();
    }, []);

    const fetchUserData = async () => {
        try {
            const userData = await getUserDetails();
            setUser(userData);
        } catch (error) {
            console.error('Failed to fetch user data', error);
        } finally {
            setLoading(false);
        }
    };

    const handleLogout = async () => {
        await logoutUser();
        navigation.replace('Login');
    };

    if (loading) {
        return (
            <View style={styles.loadingContainer}>
                <ActivityIndicator size="large" color="#2979FF" />
            </View>
        );
    }

    return (
        <View style={styles.container}>
            <View style={styles.headerBackground}>
                <LinearGradient
                    colors={['#2979FF', '#1565C0']}
                    start={{ x: 0, y: 0 }}
                    end={{ x: 1, y: 1 }}
                    style={{ flex: 1 }}
                />
            </View>

            <SafeAreaView style={{ flex: 1 }}>
                <ScrollView contentContainerStyle={styles.scrollContent} showsVerticalScrollIndicator={false}>
                    {/* Header Section */}
                    <View style={styles.header}>
                        <View>
                            <Text style={styles.greeting}>Welcome back,</Text>
                            <Text style={styles.username}>{user?.full_name || 'Resident'}</Text>
                        </View>
                        <TouchableOpacity onPress={handleLogout} style={styles.profileButton}>
                            <Ionicons name="person-circle-outline" size={40} color="#FFF" />
                        </TouchableOpacity>
                    </View>

                    {/* Banner Section */}
                    <View style={styles.bannerContainer}>
                        <LinearGradient
                            colors={['#FFca28', '#FF6F00']}
                            start={{ x: 0, y: 0 }}
                            end={{ x: 1, y: 0 }}
                            style={styles.banner}
                        >
                            <View style={styles.bannerContent}>
                                <Text style={styles.bannerTitle}>Pay Bills & Save</Text>
                                <Text style={styles.bannerText}>Get 5% cashback on your first electricity bill payment this month.</Text>
                            </View>
                            <Ionicons name="gift-outline" size={60} color="rgba(255,255,255,0.3)" style={styles.bannerIcon} />
                        </LinearGradient>
                    </View>

                    {/* Services Grid */}
                    <View style={styles.sectionHeader}>
                        <Text style={styles.sectionTitle}>My Services</Text>
                        <TouchableOpacity>
                            <Text style={styles.seeAll}>See All</Text>
                        </TouchableOpacity>
                    </View>

                    <View style={styles.grid}>
                        {services.map((service) => (
                            <ServiceCard
                                key={service.id}
                                title={service.title}
                                icon={service.icon}
                                color={service.color}
                                onPress={() => {
                                    if (['Electricity', 'Water', 'Gas'].includes(service.route)) {
                                        navigation.navigate(service.route);
                                    } else {
                                        console.log('Navigate to placeholder');
                                    }
                                }}
                            />
                        ))}
                    </View>

                    {/* Recent Activity (Mock) */}
                    <Text style={[styles.sectionTitle, { marginTop: 25 }]}>Recent Activity</Text>
                    <View style={styles.activityCard}>
                        <View style={styles.activityItem}>
                            <View style={[styles.activityIcon, { backgroundColor: '#E3F2FD' }]}>
                                <Ionicons name="flash" size={20} color="#2196F3" />
                            </View>
                            <View style={styles.activityInfo}>
                                <Text style={styles.activityTitle}>Electricity Bill Paid</Text>
                                <Text style={styles.activityDate}>Yesterday, 10:30 AM</Text>
                            </View>
                            <Text style={styles.activityAmount}>- â‚¹ 1,250</Text>
                        </View>
                        <View style={styles.divider} />
                        <View style={styles.activityItem}>
                            <View style={[styles.activityIcon, { backgroundColor: '#E0F2F1' }]}>
                                <Ionicons name="checkmark-circle" size={20} color="#009688" />
                            </View>
                            <View style={styles.activityInfo}>
                                <Text style={styles.activityTitle}>Complaint Resolved</Text>
                                <Text style={styles.activityDate}>15 Feb, 02:15 PM</Text>
                            </View>
                            <Text style={[styles.activityAmount, { color: '#009688' }]}>Closed</Text>
                        </View>
                    </View>

                </ScrollView>
            </SafeAreaView>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#F5F7FA',
    },
    headerBackground: {
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        height: 250,
        borderBottomLeftRadius: 30,
        borderBottomRightRadius: 30,
        overflow: 'hidden',
    },
    loadingContainer: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    scrollContent: {
        padding: 20,
